function App() {

  const[data, setData] = useState('');

const getData = async()=>{
  const response = await Axios.get('http://localhost:5001/getData');
  setData(response.data);
  console.log(data);
}

useEffect(()=>{
  getData();
},[]);  
  return (
    <div className="App">
      <Header />
      Data from Backend {data}
      <Footer />
    </div>
  );
}

export default App;
